tables.table_schema:
CREATE TABLE consultations ( 
    id INT PRIMARY KEY, 
    participant_name VARCHAR(50), 
    feedback TEXT, 
    consultation_date DATE 
);

CREATE TABLE ethical_concerns ( 
    concern_id INT PRIMARY KEY, 
    concern_description TEXT, 
    consultation_id INT, 
    FOREIGN KEY (consultation_id) REFERENCES consultations(id) 
);

CREATE TABLE ethical_concerns (
  concern_id INT PRIMARY KEY,
  concern_description TEXT,
  consultation_id INT,
  FOREIGN KEY (consultation_id) REFERENCES community_consultations(consultation_id)
);

CREATE TABLE consultations (
  id UUID PRIMARY KEY,
  consultation_date DATE,
  location TEXT,
  topic TEXT
);

CREATE TABLE participants (
  participant_id UUID PRIMARY KEY,
  full_name TEXT,
  email TEXT,
  organization TEXT
);

CREATE TABLE feedback (
  feedback_id UUID PRIMARY KEY,
  consultation_id UUID REFERENCES consultations(id),
  participant_id UUID REFERENCES participants(participant_id),
  feedback_text TEXT
);

CREATE TABLE ethical_concerns (
  concern_id UUID PRIMARY KEY,
  concern_description TEXT,
  relevance_rating INT
);

CREATE TABLE ar_implementation (
  impl_id UUID PRIMARY KEY,
  ar_tool TEXT,
  concern_id UUID REFERENCES ethical_concerns(concern_id)
);
